import React, {Component} from "react";
import '../tabata.css'

class Excercice extends Component {
    render() {
        return(
            <div>
                <div className="container-fluid">
                        <div className="w-100 mx-auto">
                                <div className="card">
                                            <h4 className="card-title">Vueltas:</h4>
                                            <p className="card-text">This is a longer card with supporting text below as
                                                a natural lead-in to additional content. This content is a little bit
                                                longer.</p>
                                            <p className="card-text"><small className="text-muted">Last updated 3 mins
                                                ago</small></p>
                                </div>
                        </div>
                    </div>
            </div>
        );
    }
}

export default Excercice;
